<?xml version="1.0" encoding="UTF-8"?>
<?framexs.target http://www.w3.org/2001/XMLSchema?>
<html xmlns="http://www.w3.org/1999/xhtml" prefix="og: http://ogp.me/ns#" xmlns:framexs="urn:framexs">
	<head>
		<framexs:apply src="head.fragment.xml"/>
	</head>
	<body>
		<framexs:apply src="header.fragment.xml"/>                 
		<div>
		<framexs:root>
			target namespace:<framexs:attribute name="targetNamespace"/><br/>
			elementFormDefault:<framexs:attribute name="elementFormDefault"/>
			<h2>element</h2>
			<div>
				<framexs:for-element name="element">
					<h3><framexs:value name="name"/></h3>
					<framexs:for-element name="annotation">
						<div class="annotation">
						<framexs:for-element name="documentation">
							<div class="documentation">
								<p><framexs:value name="source"/>:<framexs:text/></p>
							</div>
						</framexs:for-element>
						</div>
					</framexs:for-element>
				</framexs:for-element>
			</div>
			<h2>complextype</h2>
			<div>
				<framexs:for-element name="complexType">
					<div>name:<framexs:value name="name"/></div>
					<framexs:apply>
						
					</framexs:apply>
				</framexs:for-element>
			</div>
		</framexs:root>
		</div>
	</body>
</html>
